Formatting of a single line: 
<ul>
  <li>index of the pseudoprime, right aligned in a 9 character field
  <li>2 spaces
  <li>a character denoting the class: <b>S</b>mooth or not (<b>E</b>)
  <li>a character giving the factor count as a hexadecimal digit
  <li>a character being either blank, <b>W</b>ieferich or <b>C</b>armichael
  <li>a character to state extra pseudoprime strength: <b>S</b>trong
  <li>a space and the pseudoprime
  <li>its factors, each preceded by a space
</ul>
